  type: jsPsychCallFunction,
  func: function() {
    trial_n++;
    dot_probe_data = {
      trial_n: trial_n,
      left_stim: '',
      right_stim: '',
      probe_location: '',
      probe_direction: '',
      response_direction: '',
      rt: null
    }
  }
